import { BUY_POKEMON, RETURN_POKEMON } from "./types";

const setBuyPokemon = () => ({
    type: BUY_POKEMON,
});

const setReturnPokemon = () => ({
    type: RETURN_POKEMON,
});

export { setBuyPokemon, setReturnPokemon };
